O plano Amostral segundo os itens exigidos por lei seguem descritos: Universo: 		
Eleitorado do Município de INDAIATUBA/SP.		
com 16 anos ou mais. Amostragem - A pesquisa ira entrevistar 400 eleitores. 		
Coeficiente de confiança e margem de erro - A amostra a nível municipal tem uma margem de erro de 4,85% para um intervalo e confiança de 95% As ponderações em relação a sexo, idade, grau de instrução e nível econômico , estão descritas no questionário refletindo estatisticamente a proporção do eleitorado consultado. 		
Sexo:Masculino 47,4% Feminino 52,6% 		
Faixa Etária: De 16 a 24 anos 12,5% ; De 25 a 34 anos 19,3% ; De 35 a 44 anos 21,9% ; 		
De 45 a 59 anos 25,8% ; Mais de 60 anos 20,5% 	
Grau de Instrução: ANALFABETO/LÊ E ESCREVE	4,0	%;
ENSINO FUNDAMENTAL INCOMPLETO	16,8	%;
ENSINO FUNDAMENTAL COMPLETO	6,7	%;
ENSINO MÉDIO INCOMPLETO	10,5	%;
ENSINO MÉDIO COMPLETO	35,1	%;
SUPERIOR INCOMPLETO	6,4	%;
SUPERIOR COMPLETO	20,4	%;


Renda: Até 01 Salário Mínimo : 6,3%; De 1 a 2 salários mínimos 13,0%;		
 De 2 a 5 salários mínimos 41,1%; Acima de 5 salários mínimos 39,6% 		

FONTE DOS DADOS: https://sidra.ibge.gov.br/tabela/3268 https://www.tse.jus.br/eleitor/estatisticas-de-eleitorado/consulta-quantitativo https://www.tse.jus.br/eleitor/estatisticas-de-eleitorado/estatistica-do-eleitorado-por-sexo-e-faixa-etaria https://www.tse.jus.br/eleitor/estatisticas-de-eleitorado/estatistica-do-eleitorado-por-sexo-e-grau-de-instrucao https://praticaclinica.com.br/anexos/ccolaborativa-calculo-amostral/ccolaborativa-calculo-amostral.php

